var book = {
	"name": "၁ ယီဟၫ့",
	"numChapters": 5,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> ဆၧလၧအအီၪဝ့ၫ လၧအခၪ့ထံၭလၧအၥၫ့လၧပနါ ဂၧၫ့ဘၪယူၭပဝ့ၫ, လၧပဒၪဘၪလၧပမ့ၬၥၪ,လၧပယိ ပဝ့ၫ,ဒဲလၧပဖီၪ့ဘၪ လၧပစူၪဘၪဆဲၫ့လၧဆၧမၧၫ့အ",
			"2": "<sup>2</sup> လူ,- (တၭဆၧမၧၫ့နီၪဖျီၪထၪ့ယူၭ ဒဲဆၧမၧၫ့အဆိၩအ ကၠၪလၧအအီၪဝ့ၫ လၧဖါအၥိၭ, ဒဲဖျီၪထၪ့ဝ့ၫလၧပၧၩ နီၪပဒၪဘၪယူၭတၭ, ပထိးပၥၭတၭ, ပလီၩဘၪနၥံၪ",
			"3": "<sup>3</sup> လီၫ.)- ဆၧလၧပဒၪဘၪယူၭ, ဒဲပနါဂၧၫ့ဘၪယူၭနီၪ,ပ လီၩဘၪနၥံၪ, ဘဲၫၥိၭနၥံၪမိဖံၭၥိၭလိၬနၥံၪအၥၭလၧပ ၥိၭလီၫ. ပဝ့ၫဒၪယီၩပဖံၭၥိၭလိၬပၥၭလၧဖါဒဲအဖိၪ",
			"4": "<sup>4</sup> ခွၫယ့ၫရှူၬဎရံၬနီၪလီၫ.- ဆၧယီၩလဖၪပကွ့ၭန့နၥံၪ ဘဲၫၥိၭနၥံၪအဆၧၥၭထိၬမိလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫလီၫ.",
			"5": "<sup>5</sup> တၭဆၧလီၩလၩ့လၬလၩ့ လၧပနါဂၧၫ့ဘၪယူၭလၧ အဝ့ၫနီၪ, ပလီၩဘၪထဲၩ့နၥံၪ မွဲအယီၩ, ယွၩမွဲဆၧဖၩ့",
			"6": "<sup>6</sup> တၭ, ဆၧခံၭအီၪလၧအဖၧၩ့နးဆံၭအ့ၬ.- ပအ့ၪစံၭ လၧပဖံၭၥိၭလိၬပၥၭ လၧအဝ့ၫနီၪတၭ, လ့ၩဆၧလၧ ဆၧခံၭကျၩနီၪ, မွဲပချဲၩ့ဘျံၭချဲၩ့ဘျၪဆၧတၭ, ပလမၩ",
			"7": "<sup>7</sup> ဘၪဆၧအမွဲအတီၩလီၫ.- ပအ့ၪလ့ၩဆၧလၧဆၧဖၩ့ အကျၩ, ဘဲၫအဝ့ၫလဂၩအီၪဝ့ၫလၧဆၧဖၩ့အကျၩအ ၥိၭနီၪ, ပဖံၭၥိၭလိၬပၥၭဆုၬဆုၬတၭ, မွဲအဖိၪခွၫယ့ၫ ရှူၬဎရံၬအၥွံၪနီၪ ၥူၫဝၭဆံၫ့ခွံၬပၧၩလၧပဆၧဒဲၩဘၭ",
			"8": "<sup>8</sup> ထီးအလူၬလီၫ.- ထီးပအ့ၪစံၭလၧပဆၧဒဲၩဘၭလအီၪ ဘၪတၭ, မွဲပအၪ့လီၫလၩ့ပၥၭ, ဒဲဆၧမွဲဆၧတီၩအီၪ",
			"9": "<sup>9</sup> လၧပဖၧၩ့အ့ၬ.- ပအ့ၪလီၩလၩ့ပဆၧဒဲၩဘၭနီၪ, အ ဝ့ၫဒၪအလူတီၩဝ့ၫဘဲၫၥိၭအမိမၩဖီၩ့မၩဖျ့ၭပဆၧ ဒဲၩဘၭ, ဒဲၥူၫဝၭဆံၫ့ခွံၬပၧၩလၧကယဲဆၧအၧၩ့ဆၧၥၫ့",
			"10": "<sup>10</sup> ထီးအလူၬလီၫ.- ပအ့ၪစံၭလၧပလမၩဘၪဆၧဒဲၩ ဘၭတၭ, မွဲပအီၪက့ၪအဝ့ၫနီၪ လၧၦချဲၩ့ဘျံၭချဲၩ့ဘျၪ ဆၧတၭ, အလူအထၫ အီၪလၧပဖၧၩ့အ့ၬ."
		},
		"2": {
			"1": "<sup>1</sup> ယဖိၪဒံၩဖိၪၥၪၥံၪဧ့, ဆၧလဖၪယီၩယကွ့ၭန့နၥံၪဘဲၫၥိၭ နၥံၪထီးမၩဆၧဒဲၩဘၭ လဂ့ၩတၭ, ၦအ့ၪမၩယူၭ ဆၧဒဲၩဘၭလဂၩဂၩနီၪ, ၦအၪ့ယၫဆၧနံၫခီၫ လဂၩချဲၩ့ ဆၧလၧပဂးလၧဖါအအီၪနီၪ, အီၪဝ့ၫလဂၩတၭ, အ",
			"2": "<sup>2</sup> ဝ့ၫဒၪနီၪမွဲဆၧတီၩဆၧလီၩ့ ယ့ၫရှူၬဎရံၬနီၪလီၫ.- အဝ့ၫ ဒၪမွဲပဆၧဒဲၩဘၭ ဖီၩ့ဖျ့ၭအလးတၭ,မွဲန့ၫပဆၧဒဲၩ ဘၭလကၭလၧၩ့, မွဲဂၪ့ခိၪဖိၪထီးအလူၬအဆၧဒဲၩဘၭ အဂးဆ့လီၫ.",
			"3": "<sup>3</sup> တၭပအ့ၪထီးန့ဖံၭထၬ အဆၧမၪလူၬလဖၪနီၪ,ပၥ့ၪ",
			"4": "<sup>4</sup> ယၫလၧပၥ့ၪယၫအဝ့ၫဒၪ လၧဆၧနီၪအကၠီၩ့လီၫ.- ၦ လၧအစံၭဝ့ၫ, ယၥ့ၪယၫအဝ့ၫနီၪတၭ, လထီးန့ဘၪဆၧ မၪလူၬနီၪ, မွဲၦလၧအချဲၩ့ဘျံၭချဲၩ့ဘျၪဆၧတၭ, ဆၧမွဲ",
			"5": "<sup>5</sup> ဆၧတီၩအီၪလၧအဖၧၩ့အ့ၬ.- အ့ၪမွဲထီးဒၪၦလၧအထီး န့အလူအထၫလဂၩဂၩနီၪ, ယွၩအဆၧအဲၪ ဆၧကွံၩ လၧၫ့ထၪ့ဎွ့ၩထၪ့ယူၭ လၧအဖၧၩ့လၩ့ထံးလၩ့ဆ့ၭယူၭ တၭ, ပၥ့ၪယၫလၧပအီၪလၧအဖၧၩ့လၧဆၧနီၪအကၠီၩ့",
			"6": "<sup>6</sup> လီၫ.- ၦလၧအစံၭအအီၪဂုးခၧၫ့လၧအဖၧၩ့နီၪ, ဘဲၫ အဝ့ၫဒၪလ့ၩဆၧအၥိၭကြၨၭလ့ၩဝ့ၫဘဲၫနီၪအၥိၭဆ့ လီၫ.",
			"7": "<sup>7</sup> ၦၥၭဘီၩ့ၥံၪဧ့, ယလကွ့ၭန့ဘၪနၥံၪ လၧဆၧမၪ လူၬအၥၫ့, အ့ၪမွဲဆၧမၪလူၬအလးလံၩလၧအအီၪလၧ နၥံၪလၧဖျိၩ့လံၩလံၩနီၪလီၫ. ဆၧမၪလူၬအလးလံၩ နီၪ,မွဲဆၧအလူအထၫ လၧနၥံၪနါဂၧၫ့ယူၭလၧဖျိၩ့လံၩ",
			"8": "<sup>8</sup> လံၩလီၫ.- မၩဒီၭလဖၧၫ့ ယကွ့ၭန့နၥံၪ လၧဆၧမၪလူၬ အၥၫ့,လၧအမွဲအတီၩလၧအဝ့ၫဒၪနီၪအဖၧၩ့, ဒဲလၧန ၥံၪအဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ဆၧခံၭနီၪဒံၩခွံၬယူၭဝ့ၫ ယူၭတၭ, ဆၧအဖၩ့လၩ့ထံးလၩ့ဆ့ၭနီၪဖၩ့ထၪ့ဝ့ၫ",
			"9": "<sup>9</sup> လီၫ.- ၦလၧအစံၭအအီၪ လၧဆၧဖၩ့အကျၩ,ဒဲမ့ၬလဲၩ အထၧၫ့ဖုဝဲနီၪ, မွဲအအီၪဒံၭလၧဆၧခံၭကျၩ ခီးဘိၩ့နဲၪ့",
			"10": "<sup>10</sup> ယီၩလီၫ.- ၦလၧအအဲၪထၧၫ့ဖုဝဲနီၪ, အီၪဂုးခၧၫ့လၧ ဆၧဖၩ့အကျၩတၭ, ဆၧလၩ့ထံၩဖါအလး အီၪလၧအ",
			"11": "<sup>11</sup> ဖၧၩ့အ့ၬ.- အ့ၪမွဲၦလၧအမ့ၬလဲၩအထၧၩ့ဖုဝဲနီၪအီၪ လၧဆၧခံၭကျၩတၭ, လ့ၩဆၧလၧဆၧခံၭကျၩနီၪ,မွဲ အလ့ၩဆၧ ခီၫခီၫလဲၪတၭ, လၥ့ၪယၫဘၪ, အဂဲးဘဲၫ ယီၩ ဆၧခံၭမၩဘံၭယူၭ အမ့ၬၥၪလီၫ.",
			"12": "<sup>12</sup> ဖိၪဒံၩဖိၪၥၪၥံၪဧ့, မွဲနၥံၪအဆၧဒဲၩဘၭဖီၩ့ဖျ့ၭယူၭ လၧအဝ့ၫဒၪအမံၩ့အကၠီၩ့တၭ,ယကွ့ၭန့နၥံၪလီၫ.",
			"13": "<sup>13</sup> ဖါၥံၪဧ့, မွဲနၥံၪၥ့ၪယၫအဝ့ၫနီၪ လၧအထံၭ လၧအၥၫ့ လံၩလံၩအကၠီၩ့တၭ,ယကွ့ၭန့နၥံၪလီၫ. ဖိၪၥၪခွၫ ၥံၪဧ့,မွဲနၥံၪ မၩနၧၩ့မၩစၪၦအအၧၩ့လဂၩနီၪအကၠီၩ့, ယကွ့ၭန့နၥံၪလီၫ. ဖိၪဒံၩဖိၪၥၪၥံၪဧ့,မွဲနၥံၪၥ့ၪယၫ",
			"14": "<sup>14</sup> ဖါတၭ,ယကွ့ၭန့ယူၭ နၥံၪလီၫ.- ဖါၥံၪဧ့ မွဲနၥံၪၥ့ၪယၫ အဝ့ၫနီၪ လၧထံၭလၧၥၫ့လံၩလံၩအကၠီၩ့နီၪ, ယကွ့ၭန့ ယူၭနၥံၪယူၭ. ဖိၪၥၪခွၫၥံၪဧ့, မွဲနၥံၪအီၪဆီၪ့အီၪချဲၫ့, ဒဲယွၩအလူအထၫ အီၪဂုးခၧၫ့လၧနၥံၪအဖၧၩ့, ဒဲ နၥံၪမၩနၧၩ့မၩစၪယူၭ ၦအၧၩ့လဂၩနီၪ အကၠီၩ့, ယကွ့ၭန့ယူၭနၥံၪယူၭ.",
			"15": "<sup>15</sup> ဂၪ့ခိၪဒဲဆၧအီၪလၧဂၪ့ခိၪချိၫ့နီၪထီးအဲၪလဂ့ၩ,ၦ လဂၩဂၩအ့ၪအဲၪဂၪ့ခိၪနီၪ, ဖါအဆၧအဲၪအီၪလၧအ",
			"16": "<sup>16</sup> ဖၧၩ့အ့ၬ.-အဂဲးဘဲၫယီၩ ကယဲဆၧအီၪလၧဂၪ့ခိၪ ချိၫ့, ပဖံၭပယၪအဆၧၥၭကွံၩ,ဒဲပမ့ၬၥၪအဆၧၥၭ ကွံၩ,ဒဲအယီၩလကၠၪအဆၧထၪ့ထီၫနီၪ လဘၪ",
			"17": "<sup>17</sup> ဆဲၫ့ဘၪလၧဖါ, အ့ၪမွဲအဘၪဆဲၫ့လၧဂၪ့ခိၪလီၫ.- တၭ ဂၪ့ခိၪဒဲဂၪ့ခိၪအဆၧၥၭကွံၩနီၪ,မိဒံၩခွံၬဝ့ၫ,အ့ၪမွဲၦ မၩထီးဒၪယွၩအၥၭနီၪမိအီၪဂုးခၧၫ့အဆိၩဆိၩအကၠၪ ကၠၪလီၫ.",
			"18": "<sup>18</sup> ဖိၪဒံၩဖိၪၥၪၥံၪဧ့, အထီယီၩမွဲအထီလၧခဲၫ့ထုၬ တၭ,ဘဲၫနၥံၪနါဂၧၫ့လၧၦထၫ့ဒုၪဒၩဎရံၬမိအီၪထၪ့ အၥိၭနီၪ, ဘိၩ့နဲၪ့ယီၩၦလၧအထၫ့ဒုၪဒၩ ဎရံၬလဖၪအီၪ ဝ့ၫအၪဂၩလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ပၥ့ၪယၫမွဲအထီ",
			"19": "<sup>19</sup> လၧခဲၫ့ထုၬဘၪဝ့ၫလီၫ.- အဝ့ၫၥံၪနီၪစဲၪ့ထၪ့ခွံၬဝ့ၫလၧ ပကျၩလါနၫ့ဘိၩ, မွဲအဘၪဆဲၫ့လၧပၧၩအ့ၬ. အဂဲးဘဲၫ ယီၩအ့ၪဘၪဆဲၫ့လၧပၧၩတၭ, မွဲအမိအီၪဂုးခၧၫ့ဝ့ၫလၧ ပၥိၭလီၫ. မွဲလါနၫ့ဘိၩ, အဝ့ၫၥံၪစဲၪ့ထၪ့ဝ့ၫဘဲၫၥိၭ ဆၧမိဖျီၪထၪ့လၧၦကိၭဂၩဒ့ၭဘၪဆဲၫ့လၧပၧၩအ့ၬ.",
			"20": "<sup>20</sup> အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩ, နၥံၪဒိၭဂုၪနၥံၪအၥၭလၧၦ ဆံၫ့ဎံၪလဂၩနီၪ,နၥံၪၥ့ၪယၫဆၧထီးအလူၬလီၫ.",
			"21": "<sup>21</sup> နၥံၪလၥ့ၪယၫဘၪ ဆၧမွဲဆၧတီၩအကၠီၩ့နီၪ, ယကွ့ၭန့ ယူၭနၥံၪလမွဲဘၪ, အ့ၪမွဲနၥံၪၥ့ၪယၫဝ့ၫ, ဒဲနၥံၪၥ့ၪယၫ လၧဆၧချဲၩ့ဘျံၭချဲၩ့ဘျၪ ဘၪဆဲၫ့လၧဆၧမွဲဆၧတီၩ နး",
			"22": "<sup>22</sup> ထံၪအ့ၬ.- အ့ၪလမွဲဘၪ ၦလၧအမီၪ့ဘံၭဝ့ၫလၧယ့ၫရှူၬ မွဲဎရံၬနီၪ, ၦလၧအချဲၩ့ဘျံၭချဲၩ့ဘျၪမွဲပလၫလဂၩ လဲၪ. ၦလၧအမီၪ့ဘံၭဖါဒဲဖိၪခွၫနီၪ, မွဲၦလၧအထၫ့ဒုၪ",
			"23": "<sup>23</sup> ဒၩဎရံၬလီၫ.- ၦလဂၩလါလါ လၧအမီၪ့ဘံၭဖိၪခွၫနီၪ, အီၪလၧဖါအ့ၬ. အ့ၪမွဲၦလၧအအုၩ့လၩ့ဖိၪခွၫနီၪ, မွဲအအီၪဝ့ၫလၧဖါဆ့လီၫ.",
			"24": "<sup>24</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧလၧနၥံၪနါဂၧၫ့လၧအၥၫ့ နီၪ,မွဲအအီၪဂုးခၧၫ့လၧနၥံၪအဖၧၩ့ဆံၭ. ဆၧလၧန ၥံၪနါဂၧၫ့လၧအၥၫ့နီၪ, အ့ၪအီၪဂုးခၧၫ့လၧနၥံၪ အဖၧၩ့ တၭ,နၥံၪမိအီၪဂုးခၧၫ့ လၧဖိၪခွၫ ဒဲလၧဖါအဖၧၩ့ဆ့",
			"25": "<sup>25</sup> လီၫ.- တၭဆၧယီၩမွဲအစံၭဝဲၩ လၧအနၫ့ဆါဒၪဝ့ၫလီၩ ဘၪဝဲၩပၧၩနီၪ, မွဲဆၧမၧၫ့အဆိၩအကၠၪလီၫ.",
			"26": "<sup>26</sup> ဆၧယီၩလဖၪယကွ့ၭန့နၥံၪ လၧၦအၪ့လီၫန့နၥံၪအ",
			"27": "<sup>27</sup> ဂဲးအကၠီၪ့လဖၪလီၫ.- မွဲလါနၫ့ဘိၩ ဆၧဂုၪလၧနၥံၪဒိၭ န့ဘၪဝ့ၫနီၪ အီၪလၧနၥံၪအဖၧၩ့တၭ, ၦလဂၩဂၩၥီၪ့ ထဲၩ့ၥၫ့ထဲၩ့နၥံၪအလးအီၪအ့ၬ. အ့ၪမွဲဘဲၫဆၧဂုၪနီၪ ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့နၥံၪလၧဆၧထီးအလူၬအဂဲးအကၠီၪ့ အၥိၭတၭ, မွဲအတီၩလမွဲဘၪ ဆၧအဘျံၭအဘျၪနီၪ, ဘဲၫအၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ နၥံၪအၥိၭနီၪအီၪဂုးခၧၫ့နၥံၪဝ့ၫ",
			"28": "<sup>28</sup> လၧအဖၧၩ့ဆံၭ.- တၭဘိၩ့နဲၪ့ယီၩ, ဖိၪဒံၩဖိၪၥၪၥံၪဧ့, ထီးအဝ့ၫဒၪ အ့ၪဖျီၪထၪ့တၭ, ဘဲၫၥိၭပမိအီၪက့ၪပၥၭ ဒူၩ,ထီးအဂဲၫဝ့ၫတၭ ပမ့ၬထီးမဲဘၪ လၧအမ့ၬယၫလ",
			"29": "<sup>29</sup> ဂ့ၩတၭ,အီၪဂုးခၧၫ့ လၧအဖၧၩ့ဆံၭ.- နၥံၪအ့ၪၥ့ၪယၫ လၧအဝ့ၫဒၪ မွဲဆၧတီၩဆၧလီၩ့တၭ, နၥံၪၥ့ၪယၫလၧ ကယဲၦလၧအမၩ ဆၧတီၩဆၧလီၩ့လဂၩလါလါနီၪ,မွဲ အဘၪဆၧထၪ့ဖိၪဝ့ၫလၧအဝ့ၫနီၪလီၫ."
		},
		"3": {
			"1": "<sup>1</sup> ဘဲၫၥိၭဆၧမိကိၭပၧၩ လၧယွၩအဖိၪနီၪ, ဖါဖ့ၪလၫ့ ယူၭပၧၩလၧဆၧအဲၪဆၧကွံၩဆံၭအၪလဲၪနီၪ,ယိဆီၫ့ မီၪ့ခွါဆံၭ. မၩအၥၭဘဲၫနီၪတၭး ဂၪ့ခိၪဖိၪလၥ့ၪယၫ ဘၪပၧၩတၭ, အဂဲးဘဲၫယီၩ မွဲအၥ့ၪယၫအဝ့ၫနီၪဆ့",
			"2": "<sup>2</sup> အ့ၬ.- ၦၥၭဘီၩ့ၥံၪဧ့, ဘိၩ့နဲၪ့ယီၩပမွဲယွၩအဖိၪတၭ, ပမိကဲၪထၪ့ၦ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ. ဖျီၪထၪ့ဒံၭအ့ၬ. မွဲလါနၫ့ဘိၩ, ထီးအဝ့ၫလဂၩနီၪ အ့ၪဖျီၪထၪ့ခိၬတၭ,ပမိ လၩ့ဂၬအဝ့ၫဒၪ, ပၥ့ၪယၫလီၫ. အဂဲးဘဲၫယီၩဘဲၫအ",
			"3": "<sup>3</sup> ဝ့ၫဒၪအီၪဝ့ၫအၥိၭနီၪ, ပမိဒၪဘၪပဝ့ၫလီၫ. တၭကယဲ ၦလၧအအီၪလၧဆၧယိလါယီၩအဖၧၩ့လဂၩလါလါ နီၪ, မွဲအမၩဆံၫ့ဎံၪအနၫ့ဆါ ဘဲၫအဝ့ၫဒၪနီၪဆံၫ့ဎံၪဝ့ၫ",
			"4": "<sup>4</sup> အၥိၭနီၪလီၫ.- ကယဲၦလၧအမၩဆၧဒဲၩဘၭလဂၩလါ လါနီၪ, မွဲအလၨၪခၫ့ဖၬဆၧမၪလူၬတၭ, ဆၧဒဲၩဘၭနီၪ",
			"5": "<sup>5</sup> မွဲဆၧလၨၪခၫ့ဖၬ ဆၧမၪလူၬလီၫ.- တၭနၥံၪၥ့ၪယၫလၧ အဝ့ၫဒၪလဂၩအီၪဖျီၪဝ့ၫ, ဘဲၫၥိၭအမိမၩဖီၩ့မၩဖျ့ၭ ပဆၧဒဲၩဘၭတၭ, ဆၧဒဲၩဘၭအီၪလၧ အဝ့ၫဒၪအဖၧၩ့",
			"6": "<sup>6</sup> အ့ၬ.- ကယဲၦအီၪဂုးခၧၫ့ဝ့ၫ လၧအဖၧၩ့လဂၩလါလါ နီၪ, မၩဆၧဒဲၩဘၭအ့ၬ. ကယဲၦလၧအမၩဆၧဒဲၩဘၭ လဂၩလါလါနီၪ, ဒၪဘၪအဝ့ၫနီၪအ့ၬ. ၥ့ၪယၫဘၪဝ့ၫ အ့ၬ.",
			"7": "<sup>7</sup> ဖိၪဒံၩဖိၪၥၪၥံၪဧ့, ထီးဒုၭအၪ့လီၫနၥံၪအၥၭ လၧၦနး ဂၩလဂ့ၩ,ၦလၧအမၬဆၧတီၩဆၧလီၩ့နီၪ, မွဲအတီၩ အလီၩ့, ဘဲၫအဝ့ၫဒၪလဂၩတီၩဝ့ၫလီၩ့ဝ့ၫ အၥိၭနီၪ",
			"8": "<sup>8</sup> လီၫ.- ၦလၧအမၩဆၧဒဲၩဘၭနီၪဘၪဆဲၫ့လၧမုၪခီၩ လဲးလီၫ. အဂဲးဘဲၫယီၩလၧဖျိၩ့ လၧအၥၫ့လံၩလံၩနီၪ မုၪခီၩလဲးမၩဆၧဒဲၩဘၭလီၫ. တၭယွၩအဖိၪခွၫအီၪ ဖျီၪဝ့ၫလၧဆၧယီၩအဂး, ဘဲၫၥိၭအမိမၩဂၭဂီၩ့ခွံၬမုၪ",
			"9": "<sup>9</sup> ခီၩလဲးအဆၧမၩလီၫ.- ကယဲၦဘၪဆၧထၪ့ဖိၪဝ့ၫ လၧယွၩလဂၩလါလါနီၪ, မၩဆၧဒဲၩဘၭအ့ၬ. အဂဲးဘဲၫ ယီၩယွၩအချံၫအၥၪအီၪလၧအဖၧၩ့တၭ, မွဲအဘၪ ဆၧထၪ့ဖိၪဝ့ၫလၧယွၩအကၠီၩ့တၭ,မၩဆၧဒဲၩဘၭ",
			"10": "<sup>10</sup> ၥ့ၪအ့ၬ.- လၧဆၧယီၩအကၠီၩ့တၭ, ယွၩအဖိၪၥံၪ, ဒဲမုၪ ခီၩလဲးအဖိၪၥံၪ အီၪဖျီၪဝ့ၫလီၫ. ကယဲၦလၧအလမၩ ဘၪဆၧတီၩဆၧလီၩ့တၭ, ဒဲၦလၧအလအဲၪဘၪအထၧၫ့ ဖုဝဲလဂၩလါလါနီၪ ဘၪဆဲၫ့လၧယွၩအ့ၬ.",
			"11": "<sup>11</sup> အဂဲးဘဲၫ ယီၩဆၧလီၩလၩ့လၬလၩ့ လၧပနါဂၧၫ့ လၧဖျိၩ့လၧအၥၫ့လံၩလံၩနီၪမွဲအယီၩ, ဘဲၫၥိၭပမိအဲၪ",
			"12": "<sup>12</sup> လိၬပၥၭဆုၬဆုၬနီၪလီၫ.- မွဲဘဲၫစကံၫ့လၧအဘၪဆဲၫ့ လၧၦအၧၩ့လဂၩတၭ, မၩၥံၫအဖုအၥိၭနီၪ,မွဲအ့ၬ. တၭမၩၥံၫအဝ့ၫနီၪ, မွဲအဂဲးဘဲၫၥ့ၪလဲၪ. အဂဲးဘဲၫယီၩ အဆၧမၩဒၪဝ့ၫ မွဲအအၧၩ့တၭ, အဖုဝ့ၫဒၪနီၪ မွဲအတီၩ",
			"13": "<sup>13</sup> လီၫ.-ဖုၥံၪဝဲၥံၪဧ့, ဂၪ့ခိၪဖိၪအ့ၪမ့ၬလဲၩနၥံၪတၭ, ထီး ထီၫမံၫထီၫမၪလဂ့ၩ.",
			"14": "<sup>14</sup> ပၥ့ၪယၫလၧပခၫ့ဂၬယူၭ ဆၧၥံၫထီၩ့ယူၭ လၧဆၧ မၧၫ့အဖၧၩ့ယူၭး အဂဲးဘဲၫယီၩ ပအဲၪပကွံၩ ထၧၫ့ဖုဝဲ နီၪလီၫ. ၦလၧအလအဲၪဘၪ အထၧၫ့ဖုဝဲနီၪအီၪဂုးခၧၫ့",
			"15": "<sup>15</sup> လၧဆၧၥံၫအဖၧၩ့လီၫ.- ကယဲၦလၧအၥၭဂဲၫ့အ ထၧၫ့ဖုဝဲလဂၩလါလါနီၪ, မွဲၦမၩၥံၫၦၡၩလီၫ.တၭ နၥံၪၥ့ၪယၫလၧ ၦလၧအမၩၥံၫၦၡၩနီၪ, ၥၭမၧၫ့အဆိၩ",
			"16": "<sup>16</sup> အကၠၪအီၪ လၧအဖၧၩ့နးဂၩအ့ၬ.- အဝ့ၫဒၪအီၪက့ၪ လၩ့အၥၭလၧပဂးတၭ, လၧဆၧနီၪလမံၩ့အကၠီၩ့ပၥ့ၪ ယၫအဆၧအဲၪဆၧကွံၩလီၫ. တၭပဝ့ၫဒၪယီၩဂ့ၩပ အီၪက့ၪလၩ့ပၥၭလၧထၧၫ့ဖုဝဲလဖၪအဂးနီၪဆ့လီၫ.",
			"17": "<sup>17</sup> ၦလၧအအၪ့ကုၭအီၩဎွ့ၩတၭ, ဒၪဘၪအထၧၫ့ဖုဝဲန့ ဆၧအလးအီၪလယၫ့ၥၭဘၪဝ့ၫလဂၩဂၩနီၪ, မွဲယွၩ အဆၧအဲၪဆၧကွံၩအီၪဝ့ၫလၧအဖၧၩ့ဘဲၫၥ့ၪလဲၪ.",
			"18": "<sup>18</sup> ဖိၪဒံၩဖိၪၥၪၥံၪဧ့, လၧဆၧချဲၩ့မွဲဂ့ၩ, လၧဖျ့ၩအဖၧၩ့မွဲ ဂ့ၩ, ထီးအဲၪဆၧလဂ့ၩ, အ့ၪမွဲလၧဆၧမၩ,ဒဲဆၧမွဲ ဆၧတီၩအဖၧၩ့နီၪဆံၭ.",
			"19": "<sup>19</sup> ပၥ့ၪယၫလၧပဘၪဆဲၫ့လၧ ဆၧမွဲဆၧတီၩလၧဆၧ နီၪအကၠီၩ့တၭ, ပၥုၪ့မိဂုးပၥၭမိခၧၫ့လၧအမ့ၬယၫလီၫ.",
			"20": "<sup>20</sup> အဂဲးဘဲၫယီၩ ပၥၭအ့ၪအီၪက့ၪဆၧမၪ လၧပလီၩ့တၭ,",
			"21": "<sup>21</sup> ယွၩဒိၪနဲၪ့ပၥၭတၭ, ၥ့ၪယၫဆၧထီးအလူၬလီၫ.- ၦၥၭဘီၩ့ ၥံၪဧ့,ပၥၭအ့ၪလအီၪက့ၪဘၪဆၧမၪလၧပလီၩ့တၭ,ပမိ",
			"22": "<sup>22</sup> အီၪလၧပၥၭဒူၩလၧယွၩအမ့ၬယၫလီၫ.-ပအ့ၪအၪ့ကံၩ့ ဆၧလမံၩ့မံၩ့တၭ,ပန့ဆၧနီၪလီၫ. အဂဲးဘဲၫယီၩပထီးန့ ဖံၬထၬအဆၧမၪလူၬတၭ, ပမၩထီးဒၪဘၪအၥၭလီၫ.",
			"23": "<sup>23</sup> တၭအဆၧမၪလူၬ မွဲအယီၩ ဘဲၫၥိၭအမိနဲၩထဲၩ့အဖိၪ ခွၫယ့ၫရှူၬဎရံၬအမံၩ့, ဒဲအဲၪလိၬကွံၩလိၬပၥၭး ဘဲၫ",
			"24": "<sup>24</sup> အမၪလူၬပၧၩ အၥိၭနီၪလီၫ.- တၭၦလၧအထီးန့ဖံၬ ထၬအဆၧမၪလူၬလဖၪမွဲအအီၪဂုးခၧၫ့လၧအဖၧၩ့ တၭ,အဝ့ၫဒၪအီၪဂုးခၧၫ့ဝ့ၫ လၧအဖၧၩ့ဆ့လီၫ. မွဲလၧ ၥၭမုလၧအဖ့ၪလၫ့ပၧၩအကၠီၩ့နီၪ, ပၥ့ၪယၫလၧအ အီၪဂုးခၧၫ့ဝ့ၫလၧပဖၧၩ့လီၫ."
		},
		"4": {
			"1": "<sup>1</sup> ၦၥၭဘီၩ့ၥံၪဧ့, ကယဲၥၭလမံၩ့လါလါနီၪထီးနဲၩလ ဂ့ၩ,မွဲအဘၪဆဲၫ့လၧယွၩ လဘၪဆဲၫ့ဘၪလဲၪနီၪ,မၩယိ ခွါၥၭလဖၪနီၪဆံၭ. အဂဲးဘဲၫယီၩ မီၪအဘျၪလ့ၩ",
			"2": "<sup>2</sup> ထၪ့ယူၭလၧဂၪ့ခိၪချိၫ့အၪဂၩယူၭ.- တၭနၥံၪမိၥ့ၪယၫ ယွၩအၥၭလၧဆၧလမံၩ့ယီၩအကၠီၩ့, ကယဲၥၭလၧအ အုၩ့လၩ့ ယ့ၫရှူၬဎရံၬဂဲၫလၩ့ လၧဆၧဖံၭဆၧယၪ အ",
			"3": "<sup>3</sup> ဖၧၩ့နီၪ,မွဲအဘၪဆဲၫ့လၧယွၩလီၫ.- ကယဲၥၭလၧအ လအုၩ့လၩ့ဘၪ ယ့ၫရှူၬနီၪ, မွဲအလဘၪဆဲၫ့ ဘၪလၧ ယွၩတၭ, အဝ့ၫနီၪမွဲၦလၧအထၫ့ဒုၪဒၩဎရံၬ, လၧပနါ ဂၧၫ့လၧအမိဂဲၫဝ့ၫတၭ, ဘိၩ့နဲၪ့ယီၩဒၪလ့ၬ, အီၪယူၭ လၧဂၪ့ခိၪချိၫ့ယူၭ.",
			"4": "<sup>4</sup> ဖိၪဒံၩဖိၪၥၪၥံၪဧ့, နၥံၪဝ့ၫဒၪယီၩ နၥံၪဘၪဆဲၫ့လၧ ယွၩတၭ,နၥံၪမၩနၧၩ့မၩစၪယူၭအဝ့ၫၥံၪယူၭ. အဂဲး ဘဲၫယီၩဆၧအီၪ လၧနၥံၪအဖၧၩ့နီၪ ဒိၪနဲၪ့ဆၧအီၪလၧ",
			"5": "<sup>5</sup> ဂၪ့ခိၪချိၫ့ဒံၭလီၫ.- အဝ့ၫၥံၪဘၪဆဲၫ့ လၧဂၪ့ခိၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, မွဲအလီၩဘၪဝ့ၫ လၧဆၧဘၪဆဲၫ့",
			"6": "<sup>6</sup> လၧဂၪ့ခိၪတၭ, ဂၪ့ခိၪဖိၪၥံၪခိၭနၪအလူလီၫ.- ပဝ့ၫဒၪ ယီၩပဘၪဆဲၫ့လၧယွၩလီၫ. ၦလၧအၥ့ၪယၫယွၩနီၪ, ခိၭနၪပလူတၭ, ၦလၧအလအီၪဘၪ လၧယွၩအဖၧၩ့ နီၪ,ခိၭနၪပလူအ့ၬ. ပၥ့ၪယၫၥၭလၧအဘၪဆဲၫ့လၧ ဆၧမွဲဆၧတီၩ, ဒဲၥၭလၧအဘၪဆဲၫ့ လၧဆၧအၪ့လံၬ အၪ့လီၫလၧဆၧနီၪ အကၠီၩ့လီၫ.",
			"7": "<sup>7</sup> ၦၥၭဘီၩ့ၥံၪဧ့, မွဲပအဲၪလိၬပၥၭဆုၬဆုၬဘီၪ. အ ဂဲးဘဲၫယီၩ ဆၧအဲၪဆၧကွံၩ ဂဲၫလၧယွၩ အအီၪတၭ, ကယဲၦလၧအအဲၪဆၧ လဂၩလါလါနီၪ, ဘၪဆၧထၪ့",
			"8": "<sup>8</sup> ဖိၪဝ့ၫလၧယွၩတၭ ၥ့ၪယၫယွၩလီၫ.- ၦလၧအလအဲၪ ဘၪဆၧနီၪ, ၥ့ၪယၫယွၩအ့ၬ. အဂဲးဘဲၫယီၩယွၩမွဲ",
			"9": "<sup>9</sup> ဆၧအဲၪဆၧကွံၩလီၫ.- ယွၩအဆၧအဲၪဆၧကွံၩအီၪဖျီၪ ထၪ့ဝ့ၫ လၧပဂးဘဲၫယီၩ, အဖိၪခွၫလၧအထၪ့ဖိၪဝ့ၫ လဂၩဎးယွၩအၪ့မၧၫ့လၩ့ဝ့ၫလၧဂၪ့ခိၪချိၫ့, ဘဲၫၥိၭပမိ",
			"10": "<sup>10</sup> မၧၫ့လၧအကၠီၩ့လီၫ.- ဆၧအဲၪအီၪဝ့ၫလၧဆၧယီၩ အဖၧၩ့,လမွဲဘၪလၧပအဲၪယွၩအကၠီၩ့, မွဲလၧအဝ့ၫဒၪ အဲၪပၧၩတၭ, အၪ့မၧၫ့လၩ့အဖိၪခွၫ ဘဲၫၥိၭအမိကဲၪပ ဆၧဒဲၩဘၭဖီၩ့ဖျ့ၭအလးလီၫ.",
			"11": "<sup>11</sup> ၦၥၭဘီၩ့ၥံၪဧ့, ယွၩအ့ၪအဲၪပၧၩဎွ့ၩနီၪတၭ, ကြၨၭ",
			"12": "<sup>12</sup> လၧပအဲၪလိၬကွံၩလိၬပၥၭဆုၬဆုၬဆ့လီၫ.- ၦလၧ အဒၪဘၪယွၩနီၪ အီၪနးဆိၭနးဂၩအ့ၬ. ပအ့ၪအဲၪ လိၬပၥၭဆုၬဆုၬတၭ, ယွၩအီၪဂုးခၧၫ့ဝ့ၫ လၧပဖၧၩ့ တၭ, အဆၧအဲၪဆၧကွံၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫလၧပ",
			"13": "<sup>13</sup> ဖၧၩ့လီၫ.- ပၥ့ၪယၫလၧပအီၪဂုးခၧၫ့လၧအဖၧၩ့,ဒဲအ ဝ့ၫဒၪနီၪအီၪလၧပဖၧၩ့ဆ့လၧဆၧလမံၩ့ယီၩအကၠီၩ့, အဂဲးဘဲၫယီၩ ယွၩဖ့ၪလၫ့ပၧၩလၧအၥၭမုလီၫ.",
			"14": "<sup>14</sup> တၭပဒၪဘၪယူၭ, ဒဲပထိးပၥၭလၧဖါ အၪ့မၧၫ့လၩ့ အဖိၪခွၫ, ဘဲၫၥိၭအမိထိးထဲၩ့တၩ့ထဲၩ့ ၦဂၪ့ခိၪဖိၪၥံၪ",
			"15": "<sup>15</sup> လီၫ.-ထီးဒၪၦလၧအအုၩ့လၩ့လၧယ့ၫရှူၬမွဲယွၩအဖိၪ ခွၫနီၪ, ယွၩအီၪဂုးခၧၫ့ဝ့ၫလၧအဖၧၩ့တၭ, အဝ့ၫဒၪ",
			"16": "<sup>16</sup> နီၪအီၪဂုးခၧၫ့ လၧယွၩအဖၧၩ့ဆ့လီၫ.- ပၥ့ၪယၫယူၭ ဒဲပနဲၩယူၭ ယွၩအဆၧအဲၪလၧပဂး အဂဲးအကၠီၪ့နီၪ လီၫ. ယွၩမွဲဆၧအဲၪဆၧကွံၩတၭ, ၦလၧအအီၪဂုးခၧၫ့ ဝ့ၫလၧဆၧအဲၪဆၧကွံၩအဖၧၩ့နီၪ မွဲအအီၪဂုးခၧၫ့ဝ့ၫ လၧယွၩအဖၧၩ့, ဒဲယွၩအီၪလၧအဖၧၩ့ဆ့လီၫ.",
			"17": "<sup>17</sup> ဆၧအဲၪဆၧကွံၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ လၧပဖၧၩ့လၧဆၧ လမံၩ့ယီၩအကၠီၩ့ ဘဲၫၥိၭပမိအီၪလၧပၥၭဒူၩ လၧဆၧ စ့ၩရၫ့ခွးအမုနံၩလီၫ. အဂဲးဘဲၫယီၩ ဘဲၫအဝ့ၫနီၪအီၪ ဝ့ၫအၥိၭ,ပအီၪပဝ့ၫ လၧဂၪ့ခိၪချိၫ့ယီၩ ဘဲၫနီၪအၥိၭ",
			"18": "<sup>18</sup> လီၫ.- ဆၧၥၭမဲၪၥၭဖျဲၩ့ အီၪဝ့ၫလၧဆၧအဲၪဆၧကွံၩအ ဖၧၩ့အ့ၬ. ဆၧအဲၪဆၧကွံၩ လၧအလၧၫ့အဎွ့ၩနီၪနၫ့ထၪ့ ခွံၬဆၧၥၭမဲၪၥၭဖျဲၩ့လီၫ. အဂဲးဘဲၫယီၩ ဆၧၥၭမဲၪၥၭ ဖျဲၩ့နီၪအီၪလၧဆၧခိဆၧဝီၩ, ဒဲၦလၧအၥၭမဲၪဆၧနီၪ",
			"19": "<sup>19</sup> အဆၧအဲၪ လၧၫ့ထၪ့ဎွ့ၩထၪ့ဒံၭအ့ၬ.- ပဝ့ၫဒၪယီၩပ အဲၪဆၧမွဲလၧအဝ့ၫဒၪနီၪအဲၪဆိၫပၧၩအကၠီၩ့လီၫ.",
			"20": "<sup>20</sup> ၦလဂၩအ့ၪစံၭဝ့ၫ, ယအဲၪယွၩနီၪတၭ, အ့ၪမ့ၬလဲၩအ ထၧၫ့ဖုဝဲလဂၩနီၪ မွဲအချဲၩ့ဘျံၭချဲၩ့ဘျၪဆၧလီၫ. အ ဂဲးဘဲၫယီၩ ၦလၧအလအဲၪဘၪ အထၧၫ့ဖုဝဲလၧအဒၪ ဘၪဝ့ၫနီၪ, မွဲအမိအဲၪယွၩလၧအလဒၪဘၪဝ့ၫနီၪမိၥ့ၪ",
			"21": "<sup>21</sup> ဘဲၫၥ့ၪလဲၪ.- တၭဆၧမၪလူၬလၧပန့ဘၪလၧအဝ့ၫနီၪ မွဲအယီၩ, ၦလၧအအဲၪယွၩနီၪ, မွဲအအဲၪထၧၫ့ဖုဝဲဆ့ ဆံၭ."
		},
		"5": {
			"1": "<sup>1</sup> ကယဲၦလၧအနဲၩ လၧယ့ၫရှူၬမွဲဎရံၬလဂၩလါလါ နီၪယွၩထၪ့ဖိၪအဝ့ၫဒၪတၭ, ကယဲၦလၧအအဲၪၦထၪ့ ဖိၪဆၧလဂၩနီၪ, မွဲအမိအဲၪၦလၧအဘၪ ဆၧထၪ့ဖိၪဝ့ၫ",
			"2": "<sup>2</sup> ဒၪဆ့လီၫ.- လၧဆၧနီၪအကၠီၩ့ထီးပအဲၪယွၩ, ဒဲထီးန့ ဖံၭထၬအဆၧမၪလူၬလဖၪနီၪ, ပၥ့ၪယၫလၧပအဲၪယွၩ",
			"3": "<sup>3</sup> အဖိၪအလံၩလီၫ.- အဂဲးဘဲၫယီၩ ဆၧအဲၪယွၩ မွဲအ ယီၩ, ပထီးန့ဖံၭထၬ ဆၧမၪလူၬလဖၪလီၫ. တၭအ",
			"4": "<sup>4</sup> ဆၧမၪလူၬလဖၪနီၪမွဲလကၪလဂဲၩဘၪလီၫ.- အဂဲး ဘဲၫယီၩ ကယဲၦလၧယွၩထၪ့ဖိၪဝ့ၫလဂၩဂၩနီၪမၩနၧၩ့ မၩစၪဂၪ့ခိၪလီၫ. တၭဆၧမၩနၧၩ့မၩစၪဂၪ့ခိၪမွဲအ",
			"5": "<sup>5</sup> ယီၩပဆၧနဲၩလီၫ.- အ့ၪလမွဲဘၪ ၦလၧအနဲၩလၧယ့ၫ ရှူၬမွဲယွၩအဖိၪခွၫတၭ, မွဲပလၫ မၩနၧၩ့မၩစၪ ဂၪ့ခိၪ နီၪလဂၩလဲၪ.",
			"6": "<sup>6</sup> ၦလၧအဂဲၫဝ့ၫလၧထံၫဒဲဆၧၥွံၪနီၪ, မွဲယ့ၫရှူၬဎရံၬ လီၫ. လမွဲဘၪန့ၫလၧထံၫအဖၧၩ့, အ့ၪမွဲလၧထံၫဒဲဆၧ ၥွံၪအဖၧၩ့လီၫ. ၥၭမုနီၪမွဲဆၧလၧအထိးအၥၭလီၫ.",
			"7": "<sup>7</sup> အဂဲးဘဲၫယီၩ ၥၭမုနီၪမွဲဆၧမွဲဆၧတီၩလီၫ.- အဂဲးဘဲၫ ယီၩ ဆၧၥၧၫ့မံၩ့အီၪဝ့ၫလၧအထိးအၥၭ,ၥၭမု, ဒဲထံၫ,",
			"8": "<sup>8</sup> ဒဲဆၧၥွံၪလီၫ.-- ဆၧၥၧၫ့မံၩ့နီၪ ထိးအၥၭလမံၩ့ဎး",
			"9": "<sup>9</sup> လီၫ.- ၦၡၩအဆၧထိးအၥၭနီၪ, ပအ့ၪဒိၭန့တၭ, ယွၩ အဆၧထိးအၥၭနီၪ မွဲအဒိၪနဲၪ့အနီၪဒံၭလီၫ. အဂဲးဘဲၫ ယီၩဆၧနီၪမွဲ ယွၩအဆၧထိးအၥၭ လၧအဖိၪခွၫအဂဲး",
			"10": "<sup>10</sup> အကၠီၪ့လီၫ.- ၦလၧအနဲၩထဲၩ့ယွၩအဖိၪခွၫနီၪ, အီၪ လၧဆၧထိးအၥၭ လၧအနၫ့ဆါဒၪဝ့ၫအဖၧၩ့လီၫ. ၦ လၧအလနဲၩဘၪယွၩနီၪ, မွဲအအီၪက့ၪဝ့ၫ လၧၦချဲၩ့ ဘျံၭချဲၩ့ဘျၪဆၧလီၫ. အဂဲးဘဲၫယီၩ လနဲၩဘၪဆၧ ထိးအၥၭလၧယွၩထိးအၥၭ လၧအဖိၪခွၫအဂဲးအကၠီၪ့ လီၫ.",
			"11": "<sup>11</sup> တၭဆၧထိးအၥၭယီၩ, ယွၩဖ့ၪလၫ့ပၧၩလၧဆၧမၧၫ့ အဆိၩအကၠၪတၭ, ဆၧမၧၫ့နီၪ, အီၪဝ့ၫလၧအဖိၪခွၫ",
			"12": "<sup>12</sup> အဖၧၩ့လီၫ.- ၦအီၪလၧအဖိၪခွၫနီၪ,အီၪဝ့ၫလၧဆၧ မၧၫ့တၭ,ၦလၧအလအီၪဘၪ လၧယွၩအဖိၪခွၫနီၪ, မွဲ လအီၪဘၪ လၧဆၧမၧၫ့လီၫ.",
			"13": "<sup>13</sup> ဆၧယီၩလဖၪ ယကွ့ၭန့ယူၭနၥံၪယူၭ, ဘဲၫၥိၭနၥံၪ မိၥ့ၪယၫ လၧၦလၧအနဲၩယွၩအဖိၪခွၫအမံၩ့ နၥံၪဝ့ၫ",
			"14": "<sup>14</sup> ယီၩ,နၥံၪအီၪလၧဆၧမၧၫ့အဆိၩအကၠၪလီၫ.- တၭ ပအီၪလၧပၥၭဒူၩ လၧအမ့ၬယၫမွဲဆၧယီၩ, ပအ့ၪအၪ့ ကံၩ့ဆၧလမံၩ့ ထီးဒၪအၥၭတၭ, မွဲအခိၭနၪပလူလီၫ.",
			"15": "<sup>15</sup> ထီးဒၪပအၪ့ကံၩ့ဆၧလမံၩ့မံၩ့နီၪ, ပအ့ၪၥ့ၪယၫလၧအ ခိၭနၪပလူတၭ, ဆၧအၪ့ကံၩ့လၧပအၪ့ကံၩ့နီၪ ပၥ့ၪ",
			"16": "<sup>16</sup> ယၫလၧပန့ဘၪလီၫ.- ၦလဂၩဂၩ အ့ၪဒၪဘၪအထၧၫ့ ဖုဝဲမၩဆၧဒဲၩဘၭ လၧအလဘၪဆဲၫ့ ဘၪလၧဆၧၥံၫ လမံၩ့မံၩ့တၭ, မွဲအမိဘၩဆိၪဖၪန့အဂးတၭ, ၦလၧအ မၩဆၧဒဲၩဘၭ လၧအလဘၪဆဲၫ့ဘၪ လၧဆၧၥံၫလဖၪ နီၪဆၧမိဖ့ၪလၫ့ဝ့ၫ လၧဆၧမၧၫ့လီၫ. ဆၧဒဲၩဘၭလၧအ ဘၪဆဲၫ့လၧဆၧၥံၫနီၪ အီၪဝ့ၫလီၫ. ဘဲၫၥိၭအမိအၪ့ကံၩ့",
			"17": "<sup>17</sup> ဆၧလၧဆၧနီၪလမံၩ့အဂးယစံၭအ့ၬ.- ကယဲဆၧ လတီၩလလီၩ့ဘၪ မွဲဆၧဒဲၩဘၭလီၫ. တၭဆၧဒဲၩ ဘၭလၧအလဘၪဆဲၫ့ဘၪလၧဆၧၥံၫအီၪဝ့ၫလီၫ.",
			"18": "<sup>18</sup> ပၥ့ၪယၫလၧကယဲၦလၧယွၩထၪ့ဖိၪဝ့ၫ လဂၩလါ လါနီၪ, မွဲအလမၩဘၪဆၧဒဲၩဘၭး အ့ၪမွဲၦလၧယွၩ ထၪ့ဖိၪဝ့ၫနီၪ, ခိၭအၥၭဒၪဝ့ၫတၭ, ၦအၧၩ့လဂၩနီၪ",
			"19": "<sup>19</sup> ထိၭဘၪဝ့ၫအ့ၬ.- ပၥ့ၪယၫလၧပဘၪဆဲၫ့လၧယွၩနီၪ, ဒဲလၧဂၪ့ခိၪထီးအလူၬ အီၪလၧၦအၧၩ့လဂၩဂၩအဖၧၩ့",
			"20": "<sup>20</sup> လီၫ.- ပၥ့ၪယၫလၧယွၩအဖိၪခွၫဂဲၫဝ့ၫနီၪ, ဖ့ၪလၫ့ပၥၭ ကိၪ့ၥ့ၪဘဲၫၥိၭပမိၥ့ၪယၫၦအတီၩလဂၩ, တၭပအီၪ လၧၦတီၩလဂၩနီၪအဖၧၩ့ ဒဲလၧအဖိၪခွၫယ့ၫရှူၬဎရံၬ အဖၧၩ့နီၪလီၫ. အဝ့ၫဒၪနီၪ မွဲယွၩလၩ့ထံးလၩ့ဆ့ၭ ဒဲ",
			"21": "<sup>21</sup> ဆၧမၧၫ့အဆိၩအကၠၪလီၫ.- ဖိၪဒံၩဖိၪၥၪၥံၪဧ့, ထီး လၩ့နၥံၪအၥၭ, ဂၭဎ့ၭခွံၬဆၧဂၩ့ဆၧဖၪ့နီၪဆံၭ. ဎအၩမံၩ့.ၭ"
		}
	}
};
module.exports = book;